import Posts from "../components/Posts/Posts";
import { SearchProvider } from "../context/SearchContext";
export default function HomePage() {
  return (
    <SearchPosts.Provider value="">
      <div>
        <h1>Home Page</h1>
        <Posts />
      </div>
    </SearchPosts.Provider>
  );
}
